import React, { useRef, useEffect } from "react";
import TweenMax, { Bounce } from "gsap";

const triggerAnimation = (burgerRef, seeds) => {};

const topBunAnimation = (burgerRef, seeds) => {
  TweenMax.fromTo(
    [burgerRef.current, seeds.current],
    0.75,
    { y: -250 },
    { ease: Bounce.easeOut, y: 0, delay: 2 },
    1
  );
};

const pickleAnimation = (pickle1, pickle2, pickle3) => {
  let pickles = [pickle1.current, pickle2.current, pickle3.current];
  TweenMax.staggerFromTo(
    pickles,
    0.5,
    { y: -250 },
    { y: 0, ease: Bounce.easeOut, delay: 1 },
    0.2
  );
};

const cheeseAnimation = (cheese1, cheese2, cheese3) => {
  let cheese = [cheese1.current, cheese2.current, cheese3.current];
  TweenMax.staggerFromTo(
    cheese,
    1,
    { y: -350 },
    { y: 0, ease: Bounce.easeOut },
    0.2
  );
};

