  useEffect(() => {
    const { doAnimation, onChangeSt } = props;

    if (doAnimation) {
      topBunAnimation(burgerRef, seeds);
      pickleAnimation(pickle1, pickle2, pickle3);
      cheeseAnimation(cheese1, cheese2, cheese3);
    }

    setTimeout(()=> {
      onChangeSt()
    }, 3000)
  });

